SELECT "HihokenshaTaihoTemp"."hihokenshaNo" AS HihokenshaTaihoTemp_hihokenshaNo, "HihokenshaTaihoTemp"."shikibetsuCode" AS HihokenshaTaihoTemp_shikibetsuCode, "HihokenshaTaihoTemp"."ichigoShikakuShutokuYMD" AS HihokenshaTaihoTemp_ichigoShikakuShutokuYMD, "HihokenshaTaihoTemp"."shikakuSoshitsuYMD" AS HihokenshaTaihoTemp_shikakuSoshitsuYMD, "HihokenshaTaihoTemp"."outPutShichosonCode" AS HihokenshaTaihoTemp_outPutShichosonCode, "HokenshaDankaiTemp"."賦課基準日" AS HokenshaDankaiTemp_賦課基準日, "HokenshaDankaiTemp"."生保開始日" AS HokenshaDankaiTemp_生保開始日, "HokenshaDankaiTemp"."生保終了日" AS HokenshaDankaiTemp_生保終了日, "HokenshaDankaiTemp"."老年開始日" AS HokenshaDankaiTemp_老年開始日, "HokenshaDankaiTemp"."老年終了日" AS HokenshaDankaiTemp_老年終了日, "HokenshaDankaiTemp"."年金収入額" AS HokenshaDankaiTemp_年金収入額, "HokenshaDankaiTemp"."合計所得金額" AS HokenshaDankaiTemp_合計所得金額, (CASE WHEN "HokenshaDankaiTemp"."保険者設定段階2" IS NULL OR "HokenshaDankaiTemp"."保険者設定段階2" ='' THEN "HokenshaDankaiTemp"."保険者設定段階1" ELSE "HokenshaDankaiTemp"."保険者設定段階2" END) AS HokenshaDankaiTemp_保険者設定段階, (CASE WHEN "HyojunDankaiTemp"."標準設定段階2" IS NULL OR "HyojunDankaiTemp"."標準設定段階2" ='' THEN "HyojunDankaiTemp"."標準設定段階1" ELSE "HyojunDankaiTemp"."標準設定段階2" END) AS HyojunDankaiTemp_標準設定段階 FROM "HihokenshaTaihoTemp" LEFT JOIN "HokenshaDankaiTemp" ON "HihokenshaTaihoTemp"."hihokenshaNo"="HokenshaDankaiTemp"."被保険者番号" LEFT JOIN "HyojunDankaiTemp" ON "HihokenshaTaihoTemp"."hihokenshaNo"="HyojunDankaiTemp"."被保険者番号"
AND "HihokenshaTaihoTemp"."outPutShichosonCode" IN #{市町村コード}
ORDER BY "HihokenshaTaihoTemp"."outPutShichosonCode","HihokenshaTaihoTemp"."hihokenshaNo"

SELECT * FROM( SELECT '1' as flag, * FROM( SELECT A."shichosonCode", A."保険者設定段階", count(保険者設定段階) AS 保険者設定 FROM( SELECT "HihokenshaTaihoTemp"."shichosonCode", (case when "HokenshaDankaiTemp"."保険者設定段階2" is null OR "HokenshaDankaiTemp"."保険者設定段階2" ='' then "HokenshaDankaiTemp"."保険者設定段階1" else "HokenshaDankaiTemp"."保険者設定段階2" end) as 保険者設定段階 FROM "HokenshaDankaiTemp" LEFT JOIN "HihokenshaTaihoTemp" ON "HokenshaDankaiTemp"."被保険者番号" = "HihokenshaTaihoTemp"."hihokenshaNo"
AND "HihokenshaTaihoTemp"."outPutShichosonCode" IN #{市町村コード}
) A GROUP BY A."shichosonCode",A."保険者設定段階" ORDER BY A."shichosonCode",A."保険者設定段階" ) B UNION ALL( SELECT '2' as flag, * FROM( SELECT C."shichosonCode", C."標準設定段階", count(標準設定段階) AS 標準設定段階 FROM( SELECT "HihokenshaTaihoTemp"."shichosonCode", (case when "HyojunDankaiTemp"."標準設定段階2" is null OR "HyojunDankaiTemp"."標準設定段階2" ='' then "HyojunDankaiTemp"."標準設定段階1" else "HyojunDankaiTemp"."標準設定段階2" end) as 標準設定段階 FROM "HyojunDankaiTemp" LEFT JOIN "HihokenshaTaihoTemp" ON "HyojunDankaiTemp"."被保険者番号" = "HihokenshaTaihoTemp"."hihokenshaNo"
AND "HihokenshaTaihoTemp"."outPutShichosonCode" IN #{市町村コード}
) C GROUP BY C."shichosonCode",C."標準設定段階" ORDER BY C."shichosonCode",C."標準設定段階" ) D ) ) E ORDER BY E."shichosonCode"
